import React from 'react'
import "./Login.css";

function Login() {
    return (
			<div className='login'>
				<div className='login__container'>
					<img
						src='https://www.google.com/search?q=gmail+image&rlz=1C5CHFA_enUS800US800&sxsrf=ALeKk028NBTTCJ6ydzyy7Dgtb93eOmaSRw:1624398930155&tbm=isch&source=iu&ictx=1&fir=ab3UE-B4aCw0-M%252CmcW-4V-4uf3AYM%252C_&vet=1&usg=AI4_-kRSmo4zzkryOYwB-1G2mBijVD0-BQ&sa=X&ved=2ahUKEwi__NHJnazxAhWRup4KHQrfCGMQ9QF6BAgUEAE#imgrc=ab3UE-B4aCw0-M'
						alt=''
					/>
				</div>
			</div>
		);
}

export default Login;
